        /// Timestamp when the toolset was last updated.
        /// </summary>
        [Input("updateTime")]
        public Input<string>? UpdateTime { get; set; }

        public ToolsetState()
        {
        }
        public static new ToolsetState Empty => new ToolsetState();
    }
